	string esc(const char* s)
	{
		if (s == 0)
		{
			return "<0x0>";
		}
		string s2(s);
		const char* ptr = s2.c_str();
		string tmp;

		while (*ptr != '\0')
		{
			if (*ptr == '\n')
			{
				tmp += "\\n";
			}
			else if (*ptr == '\t')
			{
				tmp += "\\t";
			}
			else 
			{
				tmp += *ptr;
			}
			++ptr;
		}
		
		return tmp;
	}

